import React from 'react'
import classes from './Article.module.css'
const Articles = (props) => {
  return (
    <ul className={classes.list}>
        {props.quotes.map((quote) => (
          <Article
            key={quote.id}
            id={quote.id}
            author={quote.author}
            text={quote.text}
          />
        ))}
      </ul>
  )
}

export default Articles
